import { useSelector } from "react-redux";

function Cart(){
    let cart=useSelector((state)=>{
        return state.items;
    });
    return (
        <div>
            <h1>Cart</h1>
            {
                cart.map((item)=>{
                    return(<li key={item.id}>{item.title}</li>)
                })
            }
        </div>
    );
}
export default Cart;
